import React, { Component } from 'react';
import Table from 'react-bootstrap/Table';
import './BoardList.css'
import SystemDbService from '../service/SystemDbService.js';
class BoardListDB extends Component{
    constructor(props) {
        super(props)
        // # 1.
        this.state = {
            SystemDB: []
        }
    }
    // # 2.
    componentDidMount() {
        SystemDbService.getSystemDB().then((res) => {
            this.setState({ SystemDB: res.data});
        });
        console.log(this.state.SystemDB)
    }

    render() {
        return (
        <div className='board'>
            <Table style={{display:'block',marginLeft:'200px',marginTop:'100px'}}>
                <thead>
                <tr>
                    <th>번호</th>
                    <th>OS_ID</th>
                    <th>OS_NAME</th>
                    <th>Type</th>
                    <th>IP</th>
                    <th>계정수</th>
                    <th>관리자</th>
                    <th>생성일자</th>
                    <th>동기화일자</th>
                    <th>동기화여부</th>
                    <th>비고</th>
                </tr>
                </thead>
                <tbody>
                {
                    this.state.SystemDB.map(
                        SystemDB =>
                            <tr key = {SystemDB.no}>
                                <td> {SystemDB.no} </td>
                                <td> {data.title} </td>
                                <td> {data.memberNo} </td>
                                <td> {data.createdTime} </td>
                                <td> {data.updatedTime} </td>
                                <td> {data.likes} </td>
                                <td> {data.counts} </td>
                            </tr>
                    )
                }
                </tbody>
            </Table>

        </div>
    );
    }


};

export default BoardListDB;
